import { Outlet } from "react-router-dom";
import { Link } from "react-router-dom";

const Layout = () => {
  return (
    <div>
      <nav>
        <ul>
          <li>
            <li>
              {" "}
              <Link to="/Notas"></Link> Notas
            </li>
          </li>
          <li>
            <li>
              {" "}
              <Link to="/Otras"></Link> Otras
            </li>
          </li>
        </ul>
      </nav>

      <Outlet />    
    </div>
  );
};



export default Layout;
